import React from 'react';

function Auth() {
  return (
    <div className="flex flex-col  pt-12 place-items-center">
      <div>
        Bon retour parmi nous ! Nous sommes très excités de vous voir à nouveau
      </div>
      <form>
        EMAIL OU NUMÉRO DE TÉLÉPHONE MOT DE PASSE Mot de passe oublié ? Login
      </form>
      <div>Pas encore de compte ? S&apos;enregistrer</div>
    </div>
  );
}

export default Auth;
